import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
//import App from './App';
//import GreetFunction from './components/GreetFunction';
//import WelcomeClass from './components/WelcomeClass';
//import HelloCreateElement from './components/HelloCreateElement';
//import HelloCreateElementByReturn from './components/HelloCreateElementByReturn';
//import GreetConst from './components/GreetConst';
import MessageClass from './components/MessageClass';

import * as serviceWorker from './serviceWorker';

ReactDOM.render(<MessageClass/>, document.getElementById('root'));

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
